import '../C_dashboard/style_dashboard.css';
import AU1841131 from "../C_dashboard/user_profiles/AU1841131.jpg"
import icon_profile_school from "../C_dashboard/icons/icon_profile_school.png"
import icon_profile_student from "../C_dashboard/icons/icon_profile_student.png"
import React from 'react';



function profile(props) {
  
  return (    
    <div class="profile">      
         <img src={AU1841131} class="user_profile" alt="icon"/>
         <div class="user_detail_type">
           
           <img src={icon_profile_student} className="profile_icon" alt="icon" />
           {props.userprofile_about}

         </div>
         <div class="user_detail_key">{props.user_name}</div>
         <div class="user_detail_key">{props.user_rollno}</div>
         <div class="user_detail">{props.user_school}</div>
         <div class="user_detail">{props.user_degree}</div>
    </div>  
  );
}

export default profile;
